import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = (props) => {
  return (
    <div>
      {props.contactsFromApp.map((contactObj) => (
        <Tile name={contact.name} description={contact.description} />
      ))}
    </div>
  );
};
